syntax = "proto3";

option java_package = "emu.grasscutter.net.proto";

import "Vector.proto";

// Name: FPIPPCDFCNG
message TreasureSeelieRegionData {
    uint32 scene_id = 3;
    uint32 JEMLKKOCEJO = 12;
    uint32 region_id = 9;
    bool is_open = 8;
    Vector region_center_pos = 5;
    float region_radius = 4;
    uint32 LDLHMJKLCCC = 7;
    uint32 open_time = 10;
    uint32 GHDEBMECPPJ = 1;
    bool is_done = 6;
}

